webpackJsonp([0xc6664b9fff2],{692:function(e,t){e.exports={data:{post:{id:"C:/FILES/git/pers/blog/content/posts/2019-01-15--vuepress/index.md absPath of file >>> MarkdownRemark",html:'<p>Lately, I’ve created some webapps with Vue and I’ve liked the experience. I don’t have a well-tested overview of all frontend frameworks though. Vue is a bit more opinionated than React, which can be an advantage or a disadvantage depending how you look at it. I enjoy having a bit more of an opinioted framework, as to avoid an “embarrassment of riches”. (I don’t want to e.g. have to choose between four routing libraries)</p>\n<h2>Vuepress</h2>\n<p>A previous blogpost discussed Gatsby, as a static site generator, used for this blog, as well as static sites in general. Recently I’ve been using a different static site framework called <strong>Vuepress</strong> to write documentation. It can be found at <a href="https://docs.rtloc.com">https://docs.rtloc.com</a>.</p>\n<p>Vuepress is a fairly recent static doc site generator. It doen’t have all the features that some more mature frameworks offer. The main advantage of Vuepress can however be the ease of including Vue components.</p>\n<p>We’re looking forward to the release of Vuepress v1! (Initial version is referred to as 0.x)</p>',htmlAst:{type:"root",children:[{type:"element",tagName:"p",properties:{},children:[{type:"text",value:"Lately, I’ve created some webapps with Vue and I’ve liked the experience. I don’t have a well-tested overview of all frontend frameworks though. Vue is a bit more opinionated than React, which can be an advantage or a disadvantage depending how you look at it. I enjoy having a bit more of an opinioted framework, as to avoid an “embarrassment of riches”. (I don’t want to e.g. have to choose between four routing libraries)"}]},{type:"text",value:"\n"},{type:"element",tagName:"h2",properties:{},children:[{type:"text",value:"Vuepress"}]},{type:"text",value:"\n"},{type:"element",tagName:"p",properties:{},children:[{type:"text",value:"A previous blogpost discussed Gatsby, as a static site generator, used for this blog, as well as static sites in general. Recently I’ve been using a different static site framework called "},{type:"element",tagName:"strong",properties:{},children:[{type:"text",value:"Vuepress"}]},{type:"text",value:" to write documentation. It can be found at "},{type:"element",tagName:"a",properties:{href:"https://docs.rtloc.com"},children:[{type:"text",value:"https://docs.rtloc.com"}]},{type:"text",value:"."}]},{type:"text",value:"\n"},{type:"element",tagName:"p",properties:{},children:[{type:"text",value:"Vuepress is a fairly recent static doc site generator. It doen’t have all the features that some more mature frameworks offer. The main advantage of Vuepress can however be the ease of including Vue components."}]},{type:"text",value:"\n"},{type:"element",tagName:"p",properties:{},children:[{type:"text",value:"We’re looking forward to the release of Vuepress v1! (Initial version is referred to as 0.x)"}]}],data:{quirksMode:!1}},fields:{slug:"/vuepress/",prefix:"2019-01-15"},frontmatter:{title:"Vue static doc site generation",subTitle:"Fancy documentation using Vue",cover:{childImageSharp:{resize:{src:"/static/vuepress-d1fed5cb9d0a4c4269c3bcc4d74d9e64-160fa.png"}}}}},author:{id:"C:/FILES/git/pers/blog/content/parts/author.md absPath of file >>> MarkdownRemark",html:"<p><strong>Wim M.</strong> Electrical engineer, computer programmer. I love prototyping, listening to science- and programming-related podcasts, etc.</p>"},footnote:{id:"C:/FILES/git/pers/blog/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li>Tech blog</li>\n<li>by <a href="https://www.wimmar.be">Wim Marynissen</a></li>\n<li><a href="https://www.wimmar.be/#contact">Contact me</a></li>\n</ul>'},site:{siteMetadata:{facebook:{appId:"411452336030178"}}}},pathContext:{slug:"/vuepress/"}}}});